import React from "react";

export default function Navbar() {
  return (
    <>
    <div className="flex justify-between w-full">
      <div className="bg-blue-600 w-1/2 py-6 md:pl-44">
        <img src="/logo/logo.png" alt="" className="md:h-28 h-24" />
      </div>
      <div className="bg-green-600 w-1/2 flex justify-end md:pr-44 py-14">
        <label htmlFor="my-drawer-4" className="drawer-button">
          <img src="/logo/menu.png" alt="" className="md:h-20 h-16" />
        </label>
      </div>
    </div>
    </>
  );
}
